import { createRoute } from "@tanstack/react-router";
import { Route } from "../routes/__root";

const StyleClassGroup = {
  homePageWrapper: "flex-col gap-2 p-[20px]",
  row: "flex gap-2",
  column: "flex-col gap-2",
  rowSpaceBetween: "flex gap-2 justify-between",
};

const HomePage = () => {
  return (
    <div className={StyleClassGroup.homePageWrapper}>
      this is home
      <div className={StyleClassGroup.rowSpaceBetween}></div>
    </div>
  );
};

export default HomePage;
export const homePageRoute = createRoute({
  getParentRoute: () => Route,
  path: "/",
  component: HomePage,
});
